import React from 'react';
import logo from './assets/tangerinerye_logo.png';
import './HomePage.css';

function HomePage() {  
  return (
    <div className={logo}>
      <img src={logo} alt="Tangerine Rye band logo" />
    </div>
  );
}

export default HomePage;
